package com.Dec07;

public class RelationalOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int a = 10;
int b = 12;
 if (a<b) {
	 System.out.println("a value is lesser than b");
	 
 }
 if (a>b) {
	 System.out.println("a value is greater than b");
 }
 if(a<=b) {
	 System.out.println("a value is lesser than or equals to b");
 }
 if (a>=b) {
	 System.out.println("a value is greater than or equals to b");
 }
	}

}
